import VueRouter from 'vue-router'

//引入组件
import Index from '../pages'
import Home from '../pages/home/home'
import Login from '../pages/login/login'
import Register from '../pages/register/register'
import Center from '../pages/center/center'
import Forum from '../pages/forum/list'
import ForumAdd from '../pages/forum/add'
import ForumDetail from '../pages/forum/detail'
import MyForumList from '../pages/forum/myForumList'
import Storeup from '../pages/storeup/list'
import News from '../pages/news/news-list'
import NewsDetail from '../pages/news/news-detail'
import yonghuList from '../pages/yonghu/list'
import yonghuDetail from '../pages/yonghu/detail'
import yonghuAdd from '../pages/yonghu/add'
import shiwuzhaolingList from '../pages/shiwuzhaoling/list'
import shiwuzhaolingDetail from '../pages/shiwuzhaoling/detail'
import shiwuzhaolingAdd from '../pages/shiwuzhaoling/add'
import xunwuqishiList from '../pages/xunwuqishi/list'
import xunwuqishiDetail from '../pages/xunwuqishi/detail'
import xunwuqishiAdd from '../pages/xunwuqishi/add'
import renlingwupinList from '../pages/renlingwupin/list'
import renlingwupinDetail from '../pages/renlingwupin/detail'
import renlingwupinAdd from '../pages/renlingwupin/add'
import aboutusList from '../pages/aboutus/list'
import aboutusDetail from '../pages/aboutus/detail'
import aboutusAdd from '../pages/aboutus/add'
import institutionSearch from '../pages/institutionSearch/institutionSearch'
import relevantInformation from '../pages/relevantInformation/relevantInformation'
import relevantInformationDetails from '../pages/relevantInformation/relevantInformationDetails'
import applyForManage from '../pages/applyForManage/applyForManage'

const originalPush = VueRouter.prototype.push
VueRouter.prototype.push = function push(location) {
	return originalPush.call(this, location).catch(err => err)
}

//配置路由
export default new VueRouter({
	routes:[
		{
      path: '/',
      redirect: '/index/home'
    },
		{
			path: '/index',
			component: Index,
			children:[
				{
					path: 'home',
					component: Home
				},
				{
					path: 'center',
					component: Center,
				},
				{
					path: 'forum',
					component: Forum
				},
				{
					path: 'forumAdd',
					component: ForumAdd
				},
				{
					path: 'forumDetail',
					component: ForumDetail
				},
				{
					path: 'myForumList',
					component: MyForumList
				},
				{
					path: 'storeup',
					component: Storeup
				},
				{
					path: 'news',
					component: News
				},
				{
					path: 'newsDetail',
					component: NewsDetail
				},
				{
					path: 'yonghu',
					component: yonghuList
				},
				{
					path: 'yonghuDetail',
					component: yonghuDetail
				},
				{
					path: 'yonghuAdd',
					component: yonghuAdd
				},
				{
					path: 'shiwuzhaoling',
					component: shiwuzhaolingList
				},
				{
					path: 'shiwuzhaolingDetail',
					component: shiwuzhaolingDetail
				},
				{
					path: 'shiwuzhaolingAdd',
					component: shiwuzhaolingAdd
				},
				{
					path: 'xunwuqishi',
					component: xunwuqishiList
				},
				{
					path: 'xunwuqishiDetail',
					component: xunwuqishiDetail
				},
				{
					path: 'xunwuqishiAdd',
					component: xunwuqishiAdd
				},
				{
					path: 'renlingwupin',
					component: renlingwupinList
				},
				{
					path: 'renlingwupinDetail',
					component: renlingwupinDetail
				},
				{
					path: 'renlingwupinAdd',
					component: renlingwupinAdd
				},
				{
					path: 'aboutus',
					component: aboutusList
				},
				{
					path: 'aboutusDetail',
					component: aboutusDetail
				},
				{
					path: 'aboutusAdd',
					component: aboutusAdd
				},
				{
					path: 'institutionSearch',
					component: institutionSearch
				},
				{
					path: 'relevantInformation',
					component: relevantInformation
				},
				{
					path: 'relevantInformationDetails',
					component: relevantInformationDetails
				},
				{
					path: 'applyForManage',
					component: applyForManage
				},
			]
		},
		{
			path: '/login',
			component: Login
		},
		{
			path: '/register',
			component: Register
		},
	]
})
